import React, { useState } from "react";

import Typography from "@material-ui/core/Typography";
import AStepperForm from "./aStepperForm";
import AStepperFormPart from "./aStepperFormPart";
import ATextField from "./aTextField";
import ASection from "./aSection";

const TestContentPanel4 = (props) => {
  return (
    <AStepperForm>
      <AStepperFormPart name="a" title="Personal Particulars">
        <ATextField name="firstName" />
        <ATextField name="lastName" />
        <ATextField name="address" />
      </AStepperFormPart>
      <AStepperFormPart name="b" title="Questionnaire 1">
        <ATextField name="Why am I here?" />
        <ATextField name="Why are you here?" />
        <ATextField name="Why are we here?" />
      </AStepperFormPart>
      <AStepperFormPart name="c" title="Questionnaire 2">
      <ATextField name="Where am I here?" />
        <ATextField name="Why are you here?" />
        <ATextField name="Why are we here?" />
      </AStepperFormPart>
    </AStepperForm>
  )
};
export default TestContentPanel4;
